import React from 'react';
import PropTypes from 'prop-types';
import volume from '../../assets/images/svg/volume.svg';


function getRotationDegrees(obj) {
    var matrix = obj.css("-webkit-transform") ||
        obj.css("-moz-transform")    ||
        obj.css("-ms-transform")     ||
        obj.css("-o-transform")      ||
        obj.css("transform");
    if(matrix !== 'none') {
        var values = matrix.split('(')[1].split(')')[0].split(',');
        var a = values[0];
        var b = values[1];
        var angle = Math.round(Math.atan2(b, a) * (180/Math.PI));
    } else { var angle = 0; }
    return (angle < 0) ? angle + 360 : angle;
}



const PlayPanelVolume = props => {


    const handleMouseDown = () => {
      alert(1);
    };

    return (
        <div className="jp-volume-controls flex-item">
            <div className="widget knob-container">
                <div className="knob-wrapper-outer">
                    <div
                        className="knob-wrapper"
                        onMouseDown={handleMouseDown}
                    >
                        <div className="knob-mask">
                            <div className="knob d3"><span /></div>
                            <div className="handle" />
                            <div className="round">
                                <img src={volume} alt="" />
                            </div>
                        </div>
                    </div>

                </div>
            </div>
        </div>
    );
};

PlayPanelVolume.propTypes = {

};

export default PlayPanelVolume;
